import { SoccerPlayer } from "./Components/SoccerPlayer";
import { Ball } from "./Components/ball";
import React from "react";
import "./App.css";

import bg from "./halisaha.png";

const kaleciTypes = [
  { name: "Kaleci", shortName: "K", Props: ["Savunma"] },
  {
    name: "Libero Kaleci",
    shortName: "LK",
    Props: ["Savunma", "Destek", "Hücum"],
  },
];
const stoperTypes = [
  {
    name: "Standart Stoper",
    shortName: "ss",
    Props: ["Savunma", "Kesici", "Sigorta"],
  },
  { name: "Libero", shortName: "L", Props: ["Savunma", "Kesici", "Sigorta"] },
  {
    name: "Pasör Stoper",
    shortName: "PS",
    Props: ["Savunma", "Kesici"],
  },
  {
    name: "Çakili Stoper",
    shortName: "ÇS",
    Props: ["Savunma", "Kesici", "Sigorta"],
  },
  { name: "Kenar", shortName: "KS", Props: ["Savunma", "Kesici", "Sigorta"] },
];

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={bg} style={{ width: 1280, height: 800 }} />
        <SoccerPlayer />
        <Ball />
      </header>
    </div>
  );
}

export default App;
